import * as React from 'react';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import LockIcon from '@mui/icons-material/Lock';
import { Typography, Button } from '@mui/material';

export default function InputAdornments() {
  const [showPassword, setShowPassword] = React.useState(false);

  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Xử lý đăng nhập ở đây
    console.log('Submit form');
  };

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '20px', backgroundColor: '#424242' }}>
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', marginBottom: '10px' }}>
        <LockIcon sx={{ fontSize: '30px', borderRadius: '50%', backgroundColor: 'rgb(215, 71, 66)', padding: '12px' }} />
      </Box>
      <Typography sx={{ color: '#fff', textAlign: 'center', marginBottom: '15px', fontSize: '20px' }}>
        Log In
      </Typography>

      <form onSubmit={handleSubmit} style={{ width: '100%', maxWidth: '400px' }}>
        <Box sx={{ display: 'flex', flexDirection: 'column', width: '100%' }}>
          <TextField
            helperText=" "
            id="username"
            label="User name"
            variant="outlined"
            fullWidth
            sx={{ marginBottom: '20px' }}
          />
          <FormControl variant="outlined" fullWidth sx={{ marginBottom: '20px' }}>
            <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
            <OutlinedInput
              id="outlined-adornment-password"
              type={showPassword ? 'text' : 'password'}
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                    edge="end"
                  >
                    {showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              }
              label="Password"
            />
          </FormControl>
          <Button type="submit" variant="contained" sx={{ backgroundColor: 'rgb(215, 71, 66)' }}>Sign In</Button>
        </Box>
      </form>

      <Box sx={{ marginTop: '20px', textAlign: 'center' }}>
        <Typography sx={{ color: 'rgb(215, 71, 66)', cursor: 'pointer' }}>
          Forgot Password?
        </Typography>
        <Typography sx={{ color: '#fff', cursor: 'pointer', marginTop: '10px' }}>
          Don't have an account? <span style={{ color: 'rgb(215, 71, 66)' }}>Sign up</span>
        </Typography>
      </Box>
    </Box>
  );
}
